import React, {useState, useEffect} from 'react';
import Chip from '@material-ui/core/Chip';

function CoursesCompleted(props) {

    const subjects = useContext(AppContext);

    const [courses, setCourses] = useState([]);

    useEffect(() => {
      console.log(props)
      setCourses(props.courses)
    }, []);

    if (courses.length > 0) {
      console.log('hi')
      console.log(courses)
      return (
        Object.keys(courses).map((index) => (
            <Chip label={courses[index]} onDelete={() => console.log("This")} color="primary" style={{ marginRight: '0.5%' }} />
        ))
      );
    } else {
      return (
        <p>No Courses Completed...</p>
      )
    }
 
}

export default CoursesCompleted;
